import styled from "styled-components";
import MainTop from "../../components/MainTop";

const SearchInput = styled.input`
  width: 100%;
  height: 60px;
  padding: 15px 30px;
  border-radius: 15px;
`;
const RecentSearchDiv = styled.div`
  display: flex;
  align-items: center;

  & > p {
    font-size: 1.4rem;
    font-weight: 500;
  }
  & > strong {
    font-size: 1.8rem;
  }
  & > span {
    margin: 0 5px 0 10px;
  }
`;
const TagWrapDiv = styled.div`
  display: flex;

  & > div {
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 5px 10px;
    background: var(--Grey-04);
    border-radius: 5px;
    margin: 0 5px;
    color: var(--Grey-01);
  }
  & p {
    font-size: 1.4rem;
  }
  & i {
    font-size: 2rem;
  }
`;
const GridContainerDiv = styled.div`
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 24px;
  margin: 40px 0 60px;
`;
const BoxDiv = styled.div`
  border: 1px solid var(--Grey-03);
  padding: 20px;
  border-radius: 18px;
  background: var(--White-01);
  display: flex;
  flex-direction: column;
`;
const IconDiv = styled.div`
  width: 40px;
  margin-bottom: 1rem;
`;
const TitleH3 = styled.h3`
  font-size: 18px;
  margin: 0 0 8px;
  font-weight: 600;
  color: #333;
`;
const DescriptionP = styled.p`
  font-size: 14px;
  color: #666;
  margin: 0;
`;
const ListWrapDiv = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 30px;
`;
const ListDiv = styled.div`
  display: flex;
  padding: 2rem;
